          d="M220 202C229.942 202 238 210.058 238 220C238 229.942 229.942 238 220 238C210.058 238 202 229.942 202 220C202 210.058 210.058 202 220 202Z"
          fill="white"
        />
      </svg>
    </div>
  );
}
